import React from 'react';
import './App.css';  // Используем общие стили

const GuestPage = () => {
  const handleSurveyClick = (surveyName) => {
    console.log(`Опрос: ${surveyName}`);
  };

  return (
    <div className="container">
      <h1 className="page-title">Список опросов</h1>
      <button
        className="btn survey-btn"
        onClick={() => handleSurveyClick('Оценка кандидата')}
      >
        Оценка кандидата
      </button>
    </div>
  );
};

export default GuestPage;
